define({"topics" : [{"title":"Page or Offset Number","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#concept_gn4_klq_xdb","attributes": {"data-id":"concept_gn4_klq_xdb",},"menu": {"hasChildren":false,},"tocID":"concept_gn4_klq_xdb-d46e64623","topics":[]},{"title":"Result Field Path","shortdesc":"\n                  <p class=\"shortdesc\">When using any pagination type, you must specify the result field path. The result       field path is the location in the\n                     response that contains the data that you want to process. \n                  </p>\n               ","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#concept_d3b_vn2_bx","attributes": {"data-id":"concept_d3b_vn2_bx",},"menu": {"hasChildren":false,},"tocID":"concept_d3b_vn2_bx-d46e64665","topics":[]},{"title":"Keep All Fields","shortdesc":"\n                  <p class=\"shortdesc\">When using any pagination type, you can configure the origin to keep all fields in       addition to those in the specified\n                     result field path. The resulting record includes all fields       in the original structure and the result field path that\n                     includes one set of data. \n                  </p>\n               ","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#concept_hdf_bgc_4z","attributes": {"data-id":"concept_hdf_bgc_4z",},"menu": {"hasChildren":false,},"tocID":"concept_hdf_bgc_4z-d46e64720","topics":[]},{"title":"Pagination Examples","href":"datacollector\/UserGuide\/Origins\/HTTPClient.html#concept_g3s_ydf_ydb","attributes": {"data-id":"concept_g3s_ydf_ydb",},"menu": {"hasChildren":true,},"tocID":"concept_g3s_ydf_ydb-d46e64786","next":"concept_g3s_ydf_ydb-d46e64786",}]});